import React from 'react';
import FundSelection from "./FundSelection";
import Frequency from "./frequency";
import Logo from "./Logo";
import Label from "./Label";
import Nav from "./Nav";

const App = () => {
  return (
    <div className="App">
      <body data-spy="scroll" data-target="#myScrollspy" data-offset="15" class="app">
        <div className="container-fluid">
          <div className="row">
          <Nav />
          <div className="containter col-lg-10 col-md-10 col-sm-10 col-xs-10">
            <main>
              <div className="content-container col-md-8">
                <h2>Page Setting</h2>
                <FundSelection />
                <hr></hr>
                <Frequency />
                <hr></hr>
                <Logo prefix="194/" bucketName="max-client-logos" />
                <hr></hr>
                <Label />
              </div>
            </main>
          </div>
        </div>
      </div>
    </body>
  </div>
  );
}

export default App;
